import asyncio
import cv2
import numpy as np
import time 

class Yolo:

    def __init__(
        self, 
        weights="yolo_packeje/yolov3.weights",
        config="yolo_packeje/yolov3.cfg",
        conf_thresh=0.7,
        nms_thresh=0.2,
    ):
        """
        Инициализация класса Yolo.
        
        Параметры:
            weights (str): Путь к файлу весов модели YOLO.
            config (str): Путь к конфигурационному файлу модели YOLO.
            conf_thresh (float): Порог уверенности для фильтрации обнаруженных объектов.
            nms_thresh (float): Порог NMS для подавления нескольких обнаруженных объектов.
        """
        self.conf_thresh = conf_thresh
        self.nms_thresh = nms_thresh
        self.net = cv2.dnn.readNet(weights, config)
        layer_names = self.net.getLayerNames()
        self.output_layers = [layer_names[i - 1] for i in self.net.getUnconnectedOutLayers()]

    async def detect(self, img, target_id) -> tuple:
        """
        Обнаружение объектов на изображении.
        
        Параметры:
            img (numpy.ndarray): Изображение, на котором нужно выполнить обнаружение объектов.
            target_id (int): Идентификатор целевого класса, который нужно обнаружить.
        
        Возвращает:
            tuple: Кортеж, содержащий рамки объектов, индексы классов и идентификаторы классов.
        """
        b, c, ids, idxs = await self.get_detection_data(img, target_id)
        return b, idxs, ids

    async def get_detection_data(self, img, target_id) -> tuple:
        """
        Получение данных об обнаруженных объектах.
        
        Параметры:
            img (numpy.ndarray): Изображение, на котором нужно выполнить обнаружение объектов.
            target_id (int): Идентификатор целевого класса, который нужно обнаружить.
        
        Возвращает:
            tuple: Кортеж, содержащий рамки объектов, уверенности, идентификаторы классов и индексы классов.
        """
        loop = asyncio.get_event_loop()
        layer_outputs = await loop.run_in_executor(None, self.get_information, img)
        height, width = img.shape[:2]
        b, c, ids, idxs = await loop.run_in_executor(None, self.thresh, layer_outputs, width, height, target_id)
        return b, c, ids, idxs

    def get_information(self, img):
        """
        Получение информации о выходных слоях модели YOLO.
        
        Параметры:
            img (numpy.ndarray): Изображение, на котором нужно выполнить обнаружение объектов.
        
        Возвращает:
            numpy.ndarray: Выходные данные модели YOLO.
        """
        blob = cv2.dnn.blobFromImage(img, 1 / 255.0, (416, 416), swapRB=True, crop=False)
        self.net.setInput(blob)
        layer_outputs = self.net.forward(self.output_layers)
        return layer_outputs

    def thresh(self, layer_outputs, width, height, target_id):
        """
        Фильтрация и подавление нескольких обнаруженных объектов.
        
        Параметры:
            layer_outputs (numpy.ndarray): Выходные данные модели YOLO.
            width (int): Ширина исходного изображения.
            height (int): Высота исходного изображения.
            target_id (int): Идентификатор целевого класса, который нужно обнаружить.
        
        Возвращает:
            tuple: Кортеж, содержащий рамки объектов, уверенности, идентификаторы классов и индексы классов.
        """
        boxes = []
        confidences = []
        class_ids = []
        
        for output in layer_outputs:
            for detection in output:
                scores = detection[5:]
                class_id = np.argmax(scores)
                confidence = scores[class_id]
                
                if confidence > self.conf_thresh and class_id == target_id:
                    box = detection[0:4] * np.array([width, height, width, height])
                    (cx, cy, w, h) = box.astype('int')
                    tx = int(cx - (w / 2))
                    ty = int(cy - (h / 2))
                    boxes.append([tx, ty, int(w), int(h)])
                    confidences.append(float(confidence))
                    class_ids.append(class_id)
        
        idxs = cv2.dnn.NMSBoxes(boxes, confidences, self.conf_thresh, self.nms_thresh)
        return boxes, confidences, class_ids, idxs

