async def nastroika(name_media, is_video):
    frame = 15  # Начальный кадр для обработки
    if is_video:
        video1 = cv2.VideoCapture(name_media)  # Открыть видеофайл
        length = int(video1.get(cv2.CAP_PROP_FRAME_COUNT))  # Получить общее количество кадров
    else:
        video1 = cv2.imread(name_media, cv2.IMREAD_COLOR)  # Загрузить изображение
        length = video1[cv2.CAP_PROP_FRAME_COUNT]  # Установить общее количество кадров в 1 для изображения

    frames = []  # Список для хранения кадров
    while frame < length / 10:  # Пока не достигнут десятый от общего количества кадров
        success, first_frame = video1.read()  # Считать текущий кадр
        video1.set(cv2.CAP_PROP_POS_FRAMES, frame)  # Установить позицию на текущий кадр
        gray = cv2.cvtColor(first_frame, cv2.IMREAD_COLOR)  # Преобразовать в оттенки серого
        frames.append(gray)  # Добавить кадр в список
        frame += 25  # Увеличить значение кадра на 25

    video1.release()  # Освободить медиа-ресурс

    median = np.median(frames, axis=0).astype(dtype=np.uint8)  # Вычислить медианное изображение

    return median  # Вернуть медианное изображение

async def detect(frame, target_class_id, objects):
    data, idxs, index = await net.detect(frame, target_class_id)  # Обнаружение объектов на кадре с помощью YOLO
    next_objects = []  # Список для хранения информации о следующих объектах
    for i in idxs.flatten():
        (x, y, w, h) = data[i]  # Извлечение координат объекта
        object_found = False  # Флаг, указывающий, найден ли объект на текущем кадре
        for j, obj in enumerate(objects):
            if obj["id"] == j and abs(x - obj["x"]) < 50 and abs(y - obj["y"]) < 50:
                # Если объект уже существует и его координаты на текущем кадре близки к предыдущим координатам
                obj["x"] = x
                obj["y"] = y
                obj["w"] = w
                obj["h"] = h
                obj["found"] = True  # Установка флага, что объект найден на текущем кадре
                obj["last_frame_index"] = index[i]  # Обновление индекса последнего кадра, на котором был обнаружен объект
                obj["frames_lost"] = 0  # Добавление этой строки для инициализации счетчика потерянных кадров, если он не существует
                next_objects.append(obj)  # Добавление объекта в список следующих объектов
                object_found = True  # Установка флага, что объект был найден
                break
        if not object_found:
            # Если объект не был найден среди существующих объектов, то добавляем его как новый объект
            next_objects.append({
                "id": len(objects),
                "x": x,
                "y": y,
                "w": w,
                "h": h,
                "found": True,
                "last_frame_index": index[i],
                "frames_lost": 0  # Добавление этой строки для инициализации счетчика потерянных кадров для нового объекта
            })

    for obj in objects:
        if "found" not in obj:
            obj["found"] = False
            obj["frames_lost"] = 0  # Добавление этой строки для инициализации счетчика потерянных кадров для существующего объекта

        if not obj["found"]:
            # Если объект не был найден на текущем кадре, увеличиваем счетчик потерянных кадров
            obj["last_frame_index"] = None
            obj["frames_lost"] += 1
            if obj["frames_lost"] > 2:
                obj["id"] = None  # Если объект потерян на протяжении 2 и более кадров, устанавливаем его ID в None
        obj["found"] = False  # Сброс флага "found" для следующего шага обработки

    objects = [obj for obj in objects if obj["id"] is not None]  # Удаление объектов с ID None
    objects += next_objects  # Добавление следующих объектов к списку объектов
    return data, idxs, index, objects  # Возврат данных, индексов, списка объектов

async def detect_new(frame, target_class_id, objects): # Более точный
    data, idxs, index = await net.detect(frame, target_class_id)
    next_objects = []

    # Создание словаря для быстрого доступа к объектам по их ID
    objects_dict = {obj["id"]: obj for obj in objects}

    for i in idxs.flatten():
        (x, y, w, h) = data[i]
        object_found = False

        # Поиск объекта по ID и близости координат
        for obj_id, obj in objects_dict.items():
            if obj_id == obj["id"] and abs(x - obj["x"]) < 50 and abs(y - obj["y"]) < 50:
                obj["x"] = x
                obj["y"] = y
                obj["w"] = w
                obj["h"] = h
                obj["found"] = True
                obj["last_frame_index"] = index[i]
                obj["frames_lost"] = 0
                next_objects.append(obj)
                object_found = True
                break

        # Создание нового объекта, если совпадение не найдено
        if not object_found:
            next_objects.append({
                "id": len(objects),
                "x": x,
                "y": y,
                "w": w,
                "h": h,
                "found": True,
                "last_frame_index": index[i],
                "frames_lost": 0
            })

    # Обновление информации о найденных и потерянных объектах
    for obj_id, obj in objects_dict.items():
        if "found" not in obj:
            obj["found"] = False
            obj["frames_lost"] = 0

        if not obj["found"]:
            obj["last_frame_index"] = None
            obj["frames_lost"] += 1
            if obj["frames_lost"] > 2:
                obj["id"] = None
        obj["found"] = False

    # Обновленный список объектов
    objects = [obj for obj in objects if obj["id"] is not None]
    objects += next_objects

    return data, idxs, index, objects


async def media_analysis(media_path: str) -> list:
    video = cv2.VideoCapture(media_path)  # Открытие видеофайла для анализа
    total_frames = int(video.get(cv2.CAP_PROP_FRAME_COUNT))  # Получение общего количества кадров в видео
    print("Кол-во кадров: ", total_frames)
    detection_data = []  # Список для хранения данных о распознавании
    objects = []  # Список для хранения объектов, обнаруженных на предыдущих кадрах
    loop = asyncio.get_event_loop()
    frame_number = 0  # Номер текущего кадра

    while True:
        start_analyze_frame = time.time()  # Запуск отсчета времени для анализа текущего кадра
        ret, frame = video.read()  # Чтение очередного кадра из видео

        if not ret:
            break  # Если чтение кадра не удалось, выход из цикла

        temporary_array = {}  # Временный словарь для хранения координат объектов на текущем кадре
        bboxes, indices, idxs, objects_new = await detect_new(frame, target_class_id, objects)  # Распознавание объектов на текущем кадре

        for i in indices:
            box = bboxes[i]
            x = round(box[0])  # Координата X верхнего левого угла объекта
            y = round(box[1])  # Координата Y верхнего левого угла объекта
            w = round(box[2])  # Ширина объекта
            h = round(box[3])  # Высота объекта
            obj_id = None

            # Поиск объекта на предыдущем кадре, который близко расположен к текущему объекту
            for obj in objects_new:
                if (
                    "frame" in obj and obj["frame"] == frame_number-1 and 
                        abs(x - obj["coordinates"][0]) < 10 and abs(y - obj["coordinates"][1]) < 10
                ):
                    obj_id = obj["id"]
                    break

            if obj_id is None:
                obj_id = str(frame_number) + "_" + str(i)  # Генерация уникального идентификатора для нового объекта
                objects_new.append({"frame": frame_number, "idx": i, "id": obj_id, "coordinates": (x, y, w, h)})
            else:
                obj = next((o for o in objects_new if o["id"] == obj_id), None)
                obj["idx"] = i
                obj["coordinates"] = (x, y, w, h)

            temporary_array[obj_id] = {"coordinates": (x, y, w, h)}  # Запись координат объекта во временный словарь

        detection_data.append(temporary_array)  # Добавление временного словаря в список данных о распознавании
        objects = objects_new.copy()  # Обновление списка объектов для следующего кадра
        frame_number += 1  # Увеличение номера текущего кадра

        print("Номер кадра: ", frame_number)
        end_analyze_frame = time.time() - start_analyze_frame  # Рассчет времени обработки текущего кадра
        print("Время обработки кадра: ", end_analyze_frame)

    video.release()  # Закрытие видеофайла
    return detection_data  # Возврат списка данных о распознавании

async def annotate_video(media_path: str, detection_data: list) -> None:
    video = cv2.VideoCapture(media_path)  # Открытие видеофайла для аннотирования

    for i, frame_data in enumerate(detection_data):
        ret, frame = video.read()  # Чтение очередного кадра видео

        if not ret:
            break

        for obj_id, obj_data in frame_data.items():
            x, y, w, h = obj_data["coordinates"]
            # Отрисовка прямоугольника вокруг объекта на кадре
            cv2.rectangle(frame, (x, y), (x + w, y + h), (0, 0, 255), 2)
            # Добавление текстовой метки с идентификатором объекта над прямоугольником
            # cv2.putText(frame, obj_id.split("_")[1], (x, y - 10), cv2.FONT_HERSHEY_SIMPLEX, 0.5, (0, 0, 255), 2)

        cv2.imshow('r.jpg', frame)  # Отображение аннотированного кадра
        cv2.waitKey(0)  # Ожидание нажатия клавиши

    video.release()  # Закрытие видеофайла
    cv2.destroyAllWindows()  # Закрытие окон отображения

